First, we need to find the symmetric difference of A and B, denoted as A △ B. The symmetric difference is the set of elements which are in either of the sets, but not in their intersection.

A △ B = (A ∪ B) - (A ∩ B)

A ∪ B = {1, 2, 3, 4}
A ∩ B = {2, 3}

A △ B = {1, 4}

Now, we need to find the complements of (A △ B) and A. Since we don't have a universal set defined, we will assume the universal set U contains all the elements in A and B.

U = {1, 2, 3, 4}

(A △ B)' = U - (A △ B) = {2, 3}
A' = U - A = {4}

Now, we need to find the symmetric difference of (A △ B)' and A':

((A △ B)' △ A') = ({2, 3} △ {4})

((A △ B)' △ A') = ({2, 3, 4} - { })

So, (A △ B)' △ A' = {2, 3, 4}.
